import React, {Component, Fragment} from 'react';
import instance from '../../services/tokenprovider';

export class GetStatistics extends Component {

        state = {
            statistics:null
        }
    componentDidMount(){
        instance.get('getstatiscs')
        // .then(responce => responce.JSON())
        .then(statistics => {
            this.setState({statistics})
            console.log(statistics)
        })

        // this.setState({statistics:statistics})
        // console.log('state ', this.state.statistics)
    }

    render(){
        if (!this.state.statistics) return null;
        return(
            <Fragment>
                <p>{this.state.statistics.allItems}</p>
            </Fragment>
        )
    }
}

export default GetStatistics;
